import { Component, OnInit } from '@angular/core';
import { Auto } from '../../models/auto.model';
import { AutoService } from '../../services/auto.service';

@Component({
  selector: 'app-autos-lista',
  templateUrl: './autos-lista.component.html',
  styleUrls: ['./autos-lista.component.scss']
})
export class AutosListaComponent implements OnInit {
  autos: Auto[] = [];
  loading = false;
  error = '';

  constructor(private autoService: AutoService) {}

  ngOnInit(): void {
    this.cargarAutos();
  }

  cargarAutos(): void {
    this.loading = true;
    this.autoService.getAutos().subscribe({
      next: (data) => {
        this.autos = data;
        this.loading = false;
      },
      error: (err) => {
        this.error = 'Error al cargar los autos';
        this.loading = false;
        console.error(err);
      }
    });
  }

  eliminarAuto(id: string): void {
    if (confirm('¿Estás seguro de eliminar este auto?')) {
      this.autoService.deleteAuto(id).subscribe({
        next: () => {
          this.cargarAutos();
        },
        error: (err) => {
          this.error = 'Error al eliminar el auto';
          console.error(err);
        }
      });
    }
  }
}
<div class="container mt-4">
  <h2>Listado de Autos</h2>

  <div class="mb-3">
    <a routerLink="/autos/nuevo" class="btn btn-primary">Agregar Nuevo Auto</a>
  </div>

  <div *ngIf="loading" class="text-center">
    <p>Cargando...</p>
  </div>

  <div *ngIf="error" class="alert alert-danger">
    {{ error }}
  </div>

  <div *ngIf="!loading && autos.length === 0" class="alert alert-info">
    No hay autos disponibles.
  </div>

  <div class="row" *ngIf="!loading && autos.length > 0">
    <div class="col-md-4 mb-4" *ngFor="let auto of autos">
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">{{ auto.marca }} {{ auto.modelo }}</h5>
          <p class="card-text">
            <strong>Año:</strong> {{ auto.anio }}<br>
            <strong>Precio:</strong> ${{ auto.precio | number:'1.2-2' }}<br>
            <strong>Color:</strong> {{ auto.color }}<br>
            <strong>Kilometraje:</strong> {{ auto.kilometraje | number }} km<br>
            <strong>Estado:</strong> 
            <span [ngClass]="auto.disponible ? 'text-success' : 'text-danger'">
              {{ auto.disponible ? 'Disponible' : 'No disponible' }}
            </span>
          </p>
          <div class="btn-group">
            <a [routerLink]="['/autos', auto.id]" class="btn btn-info">Ver</a>
            <a [routerLink]="['/autos', auto.id, 'editar']" class="btn btn-warning">Editar</a>
            <button (click)="eliminarAuto(auto.id!)" class="btn btn-danger">Eliminar</button>
          </div>
        </div>
      </div>
    </div>
  </div>
</div>
